import './App.css';
import { Route } from 'react-router-dom';
import { Routes } from 'react-router-dom';
import ExamList from './ExamModule/ExamList';
import Exam from './examModule2/Exam';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/examlist" element={<ExamList/>}/>
        <Route path="/exam1" element={<Exam/>}/>
      </Routes>
    </div>
  );
}

export default App;
